import http from "../http-common";

export const MunicipioZonaDataService = {
  getAllMunicipios() {
    return http.get("/municipios");
  },
  getAllZonas() {
    return http.get("/zonas");
  },
  getAllMagistrados(sede) {
    return http.get(`/magistrado?sede=${sede}`);
  }
};

